import moment from "moment";

function User({ user }) {
    return <li>{user.name}</li>;
}
function List({ user }) {
    return (
        <tr>
            <td>{user.name}</td>
            <td>{user.email}</td>
            <td>{user.phoneNumber}</td>
            <td>{user.address}</td>
            <td>{moment(user.createdAt).format('YYYY-MM-DD, HH:mm')}</td>
            <td>{user.isActive ? 'Active' : "Inactive"}</td>
            <td>
                <a onClick={() => view({ userId: user._id, name: user.name, phoneNumber: user.phoneNumber, address: user.address, email: user.email ? user.email : 'N/A', status: user.isActive })}><FaEye /></a>
                <a href={`/users/delete/${user._id}`}><FaTrash /></a>
                <a href={`/users/update-status/${user._id}`}><FaSync /></a>
                {/* create a onclick*/}
            </td>
        </tr>
    );
}

export default {
    User,
    List
}
